    "raw_counts <- read.delim(\"https://www.ebi.ac.uk/gxa/experiments-content/E-ENAD-22/resources/DifferentialSecondaryDataFiles.RnaSeq/raw-counts\")\n",
    "geneID <- raw_counts$Gene.ID\n",
    "sampleIndex <- grepl(\"SRR\\\\d+\", colnames(raw_counts))\n",
    "raw_counts <- as.matrix(raw_counts[,sampleIndex])\n",
    "rownames(raw_counts) <- geneID\n",
    "head(raw_counts)"
   ]
