    "sample_data <- read.delim(\"https://www.ebi.ac.uk/gxa/experiments-content/E-ENAD-22/resources/ExperimentDesignFile.RnaSeq/experiment-design\")\n",
    "rownames(sample_data) <- sample_data$Run\n",
    "keep <- c(\"Sample.Characteristic.RNA.interference.\", \"Sample.Characteristic.sex.\")\n",
    "sample_data <- sample_data[,keep]\n",
    "colnames(sample_data) <- c(\"inference\", \"sex\")\n",
    "sample_data$inference <- factor(sample_data$inference)\n",
    "head(sample_data)"
   ]
