   "source": [
    "plot_best_genes <- as_tibble(counts(dds[best_genes_total$GENES, ], normalize = TRUE),\n",
    "          rownames = 'GENES') %>%\n",
    "  pivot_longer(names_to = \"sample\", values_to = \"counts\", -GENES) %>%  \n",
    "  left_join(as_tibble(sample_data, rownames = \"sample\")) %>% \n",
    "  ggplot(aes(x = sample, y = counts, fill = inference)) +\n",
    "  geom_bar(stat = 'identity', color = \"gray30\") +\n",
    "  facet_wrap( ~ GENES, scales = \"free\", ncol = 3) +\n",
    "  theme(axis.text.x = element_text(size = 7, angle = 90),\n",
    "        axis.title.x = element_blank(),\n",
    "        legend.position = \"right\",\n",
    "        legend.text = element_text(size = 7),\n",
    "        legend.title = element_text(size = 7))\n",
    "  \n",
    "plot_best_genes"
   ]
  },
